import React, {Component} from 'react'

import './App.css'

const lista = [
    {project:'Ladokolla',
    pelatis:'Lavranos'},
    {
        project:'giannades',
        pelatis:'Kantunis'
    }

]


class FrankComponent extends Component {

    state = {
        lista,
    }

    render () {
        return(
        <div>{this.state.lista.map(x=><div key={x.objectID}>{x.project+' '+x.pelatis}</div>)}</div>   //dont forget the key
        )
    }


}


export default FrankComponent
